                <div className="col-md-3">
                <Chekbox id="checked" label="Checked" checked />
                </div>
                {/* <Chekbox id="indeterminate" label="Indeterminate" indeterminate />
                <Chekbox id="switch" label="Switch" type="switch" /> */}
